con:config.script:
import com.eviware.soapui.support.GroovyUtils

//To get testcase name
def testCaseName = context.getTestCase().name
log.info ("Testcase name is " + testCaseName)

//to get testsuite name
def testSuiteName = context.getTestCase().getTestSuite().name
log.info ("TestSuite name is " + testSuiteName)

def reqXml = context.expand('${GetProductTypesRequest#request}')
log.info ("Request is " + reqXml)

//def req = testRunner.testCase.getTestStepByName("CountryCode").getPropertyValue("request")
//log.info ("Using testunner req is " + req)

def countryName = testRunner.testCase.getPropertyValue("Name")
log.info ("Country Name is " + countryName)

//To parse the xml we need to have Groovy utils and xmlHolder
def groovyUtils = new GroovyUtils(context)

xmlholdr = groovyUtils.getXmlHolder(reqXml)
xmlholdr.setNodeValue("//web:sCountryName", countryName)

def updatedXml = xmlholdr.getXml();
log.info ("Updated Xml is " + updatedXml)

//to pass the xml to testrunner
testRunner.testCase.getTestStepByName("CountryCode").setPropertyValue("request", updatedXml)

//to run the teststep
testRunner.testCase.testSuite.project.testSuites[testSuiteName].testCases[testCaseName].testSteps["CountryCode"].run(testRunner,context)

def resp = context.expand('${CountryCode#response}')
log.info ("Response is " + resp)

def resXmlholdr = groovyUtils.getXmlHolder(resp)

def countryCode = resXmlholdr.getNodeValue("//m:CountryISOCodeResult")
log.info ("Country code is " + countryCode)

testRunner.testCase.getTestStepByName("Properties").setPropertyValue("CountryCode", countryCode)
